  const tempObj = {
    test1: {
      name: 'cats.md',
      date: '01/01/2023'
    },
    test2: {
      name: 'burger.md',
      date: '02/02/2023'
    }
  };


  //iterate through object
  const objHandler = () => {
    try {
      let stringTester = '';

      // let main = document.querySelector("document-container")

      // Object.entries(tempObj).forEach(([_, value]) => stringTester += `<{DocumentLink name={${value.name}} date={${value.date}} /> ` );

      // console.log(Object.entries(tempObj).forEach(([_k, _v]) => console.log(_k, _v)))

      const parser = new DOMParser();
      const doc = parser.parseFromString(stringTester, 'text/html');
      console.log(doc.body.firstChild)
      // string = doc.body.firstChild;
      // main.appendChild(doc.body.firstChild);
    } catch(error) {
      console.log('did not succeed');
    }

    // return (
      //<DocumentLink title={title} date={date} />
    // )
  };

  let objToArr = Object.entries(tempObj);

  console.log(Object.entries(tempObj).forEach(([_, v]) => console.log(v)))
  // objHandler();

  return(
    <div id='document-container' style={{color: 'white'}}>
      <div className="tester">
        {/* <DocumentLink name='cats' date='01/01/23'/> */}
        {objToArr.map(([_, value]) => (
          <div name={value.name} date={value.date} >
            <p className='date'>{value.date}</p>
            <a href={'reddit.com'} className='link' >{value.name}</a>
          </div>
        ))}
      </div>
    </div>
  );
}

export default DocumentList;
